            <form>
                <div className="mb-3">
                <label for="name" className="form-label">Name</label>
                <input type="text" name="name" id="name" className="form-control" area-described-by="name-info"></input>
                <label id="name-info" className="form-text">Enter your name or your company name.</label>
                </div>

                <div className="mb-3">
                <label for="type" className="form-label"></label>
                <select name="type" id="type" className="form-select" area-described-by="type-info">
